import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <div className="container">
        <nav className="navbar">
          <div className="logo">
            <i className="fas fa-robot"></i>
            <span>Nexus AI</span>
          </div>
          <div className="nav-links">
            <Link to="/">Home</Link>
            <Link to="/ai-tools">AI Tools</Link>
            <Link to="/ai-agents">AI Agents</Link>
            <Link to="/pricing">Pricing</Link>
            <Link to="/schedule-demo">Schedule A Demo</Link>
            <Link to="/blog">Blog</Link>
          </div>
          <div className="nav-buttons">
            <button className="btn btn-outline" onClick={() => window.location.href = '/signin'}>Sign In</button>
            <button className="btn btn-primary" onClick={() => window.location.href = '/get-started'}>Get Started</button>
          </div>
        </nav>
      </div>
    </header>
  );
};

export default Header;
